import './Homepage.css';
import { Link } from 'react-router-dom';

function Homepage() {

    let someId = Math.floor(Math.random() * 11);
    return(
        <main className="mainSection">
            <article className="mainArticle">
                <Link to={'/recipes/'+{someId}}>
                   <h1>Letnji kolac sa kokosom</h1>
                </Link>
                <div className="mainWallpaper">Slika</div>
                <p>Autor: Dusan</p>
            </article>
      </main>
    );
};

export default Homepage;
